import React from 'react';
import "./footer.css";
import footerLogo from "../Images/footerLogo.png"


const Footer = () => {
	return(
		<div className="footer-cont ba flex">
			<div className="about-side1 flex flex-column ba w-40 pt4">
				<button type="button" 
						class="footer-button f6 grow no-underline br-pill ph5 pv3 mb2 dib white b w5 center ">About us</button>
				<img className="footer-logo grow center" src={footerLogo} alt="logo" />
			</div>

		</div>



	)
}

export default Footer;
